tests.code:
cy.writeFile('cypress/integration/TEST/versions.csv', '\n', {
  flag: 'a+'
});
cy.request('GET', "https://www.timeapi.io/api/Time/current/coordinate").its('body.date').then(function (date) {
  cy.writeFile('cypress/integration/TEST/versions.csv', date, {
    flag: 'a+'
  });
});
cy.request('GET', "https://www.timeapi.io/api/Time/current/coordinate").its('body.dayOfWeek').then(function (dayOfWeek) {
  cy.writeFile('cypress/integration/TEST/versions.csv', ' ', {
    flag: 'a+'
  });
  cy.writeFile('cypress/integration/TEST/versions.csv', dayOfWeek, {
    flag: 'a+'
  });
  cy.writeFile('cypress/integration/TEST/versions.csv', ",", {
    flag: 'a+'
  });
});

